('AD', 'Todos aquellos servicios de apoyo, necesarios para la construcción del proyecto.', 'Indirecto', 'Costos administrativos y gestión del proyecto.', '•	Es el costo del Mandante por Administrar el Proyecto, incluye los Costos del Dueño (personal propio y sus gastos) y los Servicios de Terceros que realizar una labor de supervisión, como ITO, Servicio del Agente de Adquisiciones, componente PM y CM de Servicios EPCM, RRLL, QA/QC, SSO y  sus Gastos (alimentación traslados, Gastos Funcionales, etc).\r\n\r\n•	Es el costo laboral del personal propio y el de los servicios de terceros que realizan labor de supervisión; incluye también sus gatos tales como viajes, traslados gastos de oficina incluyendo TICA servicio de gestión documental, etc.); incluye costos en seguridad y salud ocupacional (para el staff y actividades generales para todo el proyecto), asesoría en medio ambiente y comunidad, gasto funcional entre otros.\r\n\r\no	El servicio del personal propio de acuerdo a nuestro estándar, realiza las siguientes funciones: administración de gestión de RRHH (contratación, pago remuneraciones, bienestar, etc), gestión de Relaciones Laborales RRLL (acreditación, gestión de sindicatos, gestión de campamentos, gestión de casinos, gestión de traslados de personal, etc), gestión de logística, gestión de SSO, gestión de calidad (QA/QC), capacitación, gestión de productividad bajo metodología VP, gestión de abastecimiento compras y contratos (licitaciones, administración, gestión de pagos, gestión de claim, etc), la organización de planificación estratégica (reporting interno y hacia el cliente y la autoridad), la gestión de permisos.\r\n\r\no	Gastos del personal propio: Arriendo oficinas, mantención de oficinas, arriendo de camionetas, alimentación y alojamiento, hoteles, traslados (viajes y taxis), soporte y servicios TICA, capacitaciones, estudios, gastos de auditorías internas VP, Casa Matriz y Cochilco, etc. Útiles e Insumos varios, suministros o insumos computacionales, software computacional, elementos de protección personal, exámenes pre y ocupacionales. \r\n\r\no	Apoyo terceros: normalmente existen servicios de apoyo de terceros para funciones específicas, tales como: quantity surveying (contraparte del avance de las obras), servicios de gestión de personal en terreno RRLL, servicios de gestión en la administración de campamentos y casinos, servicios de apoyo a las labores de SSO (auditorías y cursos), en otras compañías la ITO es considerada como un Indirecto del proyecto bajo el concepto de Apoyo a la Construcción, sin embargo, en estricto rigor este apoyo corresponde a supervisión en terreno la que realiza la labor del CM (Construction Management) y por tanto se debe considerar como parte de la Administración.\r\n', '2025-07-16 14:22:45', '2025-07-16 14:36:42'),
('CL', 'Todos aquellos costos de responsabilidad del cliente y aquellos que no forman parte directa de la implementación del Proyecto.', 'Costos Especiales', 'Gastos extraordinarios e imprevistos (Cliente)', '•	Corresponden a los costos de alistamiento operacional del cliente (División) y de acuerdo a lo definido por la VP, también incluyen costos especiales, tales como compensaciones medioambientales y comunitarias, compra de terrenos, compra de equipos mineros para continuidad operacional y no requeridos para desarrollo de Prestripping, etc., cualquier costo que no sea un concepto estándar de un proyecto.\r\n\r\n•	Cobros de la División por uso de instalaciones y otros servicios.\r\n\r\n•	Costos de conceptos que son especiales y sólo aplica al proyecto en particular.\r\n\r\n•	Es el costo del personal asignado por el Cliente (División) al estudio o proyecto, considera costos laborales y de servicios necesarios para que realice su labor. También se incluyen costos de capacitación del personal nuevo para la operación. Si bien en la mayoría de las industrias, este concepto de Costos Especiales y Cliente, forma parte de lo Indirectos del Proyecto, la VP, siguiendo recomendaciones de IPA, para realizar un correcto benchmarking, estos costos no se deben considerar en los indicadores, ya que son muy variables dependiendo del tipo de proyecto y las condiciones geográficas, climáticas y/o políticas.\r\n\r\n•	Costos por Paralizaciones Climáticas por condición de zona geográfica, por ejemplo detención de construcción en área abiertas entre los meses de mayo a septiembre en División Andina.\r\n', '2025-07-16 14:22:45', '2025-07-16 14:39:29'),
('CT', 'Provisión según la clase de estimación', 'Contingencias', 'Reserva financiera para contingencias', 'La Contingencia es una Provisión de dinero que tiene como propósito cubrir ítems, condiciones o eventos para los cuales su efecto es incierto, pero que existe una probabilidad de ocurrencia. El presupuesto de CAPEX de un proyecto elaborado a partir de un cierto nivel de ingeniería solo recoge cantidades, precios y los factores de crecimientos históricos y estadísticos. Pero no es capaz de pesquisar, de recoger por ejemplo los elementos que dado el nivel de precisión de la ingeniería o dicho en forma más general del estudio, no puede haber sido capturado o “visto”. Es como el ojo humano, la lupa y el microscopio. El ojo humano ve una hormiga, se requiere una lupa para ver un ácaro y un microscopio para ver un microbio. Aquello que no se “ve” se incluye en la Contingencia, nuevamente determinada a través de estadística y experiencia de la historia de muchos proyectos anteriores. Constituye un ítem del presupuesto como la mano de obra pero con una descripción genérica: Contingencia. En la medida que avanza el proyecto en su ingeniería de detalles o en la evolución de su ejecución van “apareciendo” los elementos que no se “vieron” y en aquel momento se financian con la contingencia. Por ello la contingencia está para ser usada porque cubre la imprecisión prevista. Un presupuesto sin contingencia es un presupuesto sesgado. Con la contingencia, pasa a ser un presupuesto insesgado es decir aquel que tiene la misma probabilidad de que el costo real sea mayor o menor al valor presupuestado. Por lo tanto forma parte del presupuesto y su administración es responsabilidad del Gerente de Proyecto. Proviene de un cálculo probabilístico de ocurrencia de riesgos, cuyo monto satisface los niveles de confianza del Dueño. Para el caso de CODELCO es un P50, es decir, el monto del proyecto tiene una probabilidad de 50% de ser excedido o de ser inferior. La Contingencia forma parte de la Estimación, y se va transformando en costos efectivos, en la medida que se incrementa la precisión de la ingeniería y se materializan los impactos asociados a los riesgos propios de la ejecución / administración del proyecto (Ej.- omisiones y calidad de la Ingeniería, atrasos en procesos de licitación y adquisición, atrasos en las entregas de proveedores, re-trabajo de obras de construcción, etc., por lo que se espera que sea utilizado. Errores y omisiones de planificación y estimación, fluctuaciones de precios menores, desarrollos de diseño, cambios dentro del alcance y variaciones en el mercado y las condiciones ambientales. \r\nDe lo anterior se desprende que la Contingencia no cubre ni puede cubrir eventos como una huelga, un desastre natural, una evento climático fuera de lo normalmente previsible (como un aluvión en un lugar donde no había registros anteriores, el paro de un puerto de embarque con el consiguiente retraso de los suministros, un evento político disruptor en un país proveedor de suministros para el proyecto, el hundimiento de una embarcación con suministros para el proyecto, la quiebra de una o varias empresas de servicios y/o suministros para el proyecto o actos de sabotaje, consecuencias de actos de negligencia ya sea del personal del dueño, de las empresas de ingeniería o de las empresas de suministros de bienes y servicios. Ni menos puede incluir cambios al proyecto ni en su concepto ni en su forma, como cambios importantes en el alcance, tales como cambios en la especificación del producto final, capacidades, tamaños de construcción y ubicación del activo o proyecto, eventos extraordinarios como huelgas importantes y desastres naturales, y efectos de escalamiento y moneda. \r\n\r\n•	Contingencia Probabilística\r\n•	Contingencias adicionales que se estimen necesarias para el proyecto, de acuerdo a las recomendaciones del SIC.\r\n', '2025-07-16 14:22:45', '2025-07-16 14:40:11'),
('EM', 'Costo de las instalaciones permanentes', 'Directo', 'Adquisición de equipos, maquinaria y materiales', '•	Adquisiciones Nacionales e Internacionales de equipos y todo material del proyecto, que se provee a granel (volumen).\r\n\r\n•	Corresponden a los equipos que se deberán montar o instalar para dar forma al alcance del proyecto, generalmente corresponden a equipos mecánicos, eléctricos y de instrumentación. Adicionalmente, están los materiales comprados en lotes. Estos artículos se pueden comprar desde un catálogo estándar y se compran en cantidad para ser distribución según sea necesario. Ejemplos son tuberías (no enrolladas), conductos, accesorios y cables.\r\n', '2025-07-16 14:22:45', '2025-07-16 14:31:31'),
('IC', 'Costo de las instalaciones permanentes', 'Directo', 'Costos indirectos asociados a contratistas', '•	Incluye Gastos Generales; Utilidades; Instalación de Faenas, Movilización, Desmovilización e Indirectos de Construcción. \r\n\r\n•	Corresponden a todos los costos que no se convierten en una parte final del montaje o instalación, pero son necesarios para la finalización ordenada del trabajo y pueden incluir, pero no estar limitado a: alimentación y alojamiento, transporte a la obra y transporte en la obra, equipo de seguridad o protección personal, herramientas manuales y consumibles, construcciones temporales de faena (No incluye Patio de Contratistas), movilización y desmovilización, supervisión y administración contratista, utilidades y gastos generales del contratista (costos oficina central, costos financieros, etc.)\r\n\r\n•	Gastos por eventos inciertos de responsabilidad del contratista, como el costo adicional por mal tiempo diario.\r\n\r\n•	Los Gastos a Costos Efectivos dependiendo de su naturaleza pueden ser NO parte de los (IC) Indirectos del Contratistas, por ejemplo el personal para apoyo PEM es parte de los (SC) Servicios de Apoyo a la Construcción.\r\n', '2025-07-16 14:22:45', '2025-07-16 14:30:45'),
('IE', 'Todos aquellos servicios de apoyo, necesarios para la construcción del proyecto', 'Indirecto', 'Servicios de ingeniería y consultoría técnica', '•	Desarrollo de Ingenierías (Pre-Factibilidad; Factibilidad o Detalle).\r\n\r\n•	Servicios tales como: Estudios geológicos, confección planes mineros, calicatas, sondajes, etc.\r\n\r\n•	Para el caso de EPCM, se debe considerar sólo la parte “E”, la parte P y CM (Procurement & Construcción Management), es parte de la Administración del Proyecto.\r\n\r\n•	Considera todos los costos necesarios para realizar el desarrollo de la Ingeniería, estudios ambientales y los contratos de captura información (asesores expertos, estudios de especialistas, etc).\r\n', '2025-07-16 14:22:45', '2025-07-16 14:33:43'),
('MO', 'Costo de las instalaciones permanentes', 'Directo', 'Mano de obra directa y actividades de construcción principal', '•	Considera costo Mano de Obra, uso de Equipo de apoyo a la construcción y subcontratos especializados.\r\n\r\n•	Corresponde al recurso humano necesario para la instalación o montaje de los materiales y equipos, incluyendo las obras necesarias para ello, como excavaciones, hormigones, etc. Se expresan en Horas Personas (directas y subcontratos especializados) y se valorizan de acuerdo a su valor salarial que incluye sueldo bruto, asignación de zona, tratos y bonos (acuerdo entre trabajador y contratista), vacaciones, feriados, sobre tiempo, seguros de vida, mutual de seguridad, provisión por despido y licencias médicas, inducción de seguridad, costo de la contratación y despido, acuerdos sindicales y cualquier otro componente que la legislación indique.\r\n', '2025-07-16 14:22:45', '2025-07-16 14:29:04'),
('SC', 'Todos aquellos servicios de apoyo, necesarios para la construcción del proyecto.', 'Indirecto', 'Servicios de apoyo a la construcción.', '•	Corresponden a todos los costos necesarios que dan Apoyo a la Construcción y que sin estos, las empresas contratistas no pueden operar.\r\n\r\n•	Construcción de Instalaciones Temporales; Servicios de apoyo a la construcción (administración de campamentos, policlínico, bodegas, fletes, llenado inicial, transporte personal, permisos, Vendors, Apoyo PEM, seguridad industrial, etc) y Patio de Contratistas (Urbanizado).\r\n\r\n•	Instalaciones temporales: corresponden a todo tipo de obra, que permite facilitar los procesos de construcción de las obras Directas, y sólo existirán mientras dure la Etapa Inversional, aquí encontramos: la construcción casinos, campamentos, talleres para los contratitas, preparación de áreas para patio contratistas, conexión a servicios de urbanización (electricidad, agua potable y agua servidas), preparación de áreas para bodegas, servicios de expendio de combustibles, policlínico, laboratorios para QC, construcción de caminos temporales, etc.\r\n\r\n•	Servicios de Apoyo a la Construcción: corresponden a los contratos que nos permiten administrar y entregar los servicio a los trabajadores y empresas Contratistas, algunos de estos son: transporte en la obra, alojamiento, alimentación, vigilancia, servicios médicos, administración de bodega, logística, impuestos y fletes, arriendo de grúas de gran tonelaje (si provee el mandante), asistencia del fabricante (Vendor Representatives, o Vendors), apoyo de contratistas para pre-comisionamiento (gastos a costos efectivos), lubricantes para primer llenado, repuestos para pruebas y primer y/o segundo año operación, apoyo de personal especialista que realiza las pruebas de los equipos e instrumento, bonos, beneficios y convenios especiales del cliente a contratistas, seguros de construcción, costos de interferencias por incumplimiento del mandante, etc. La ingeniería de terreno habitualmente es una extensión del contrato de ingeniería de detalles, pero la ingeniería de terreno es un servicio de apoyo durante la construcción para que los contratistas puedan realizar correctamente su trabajo, y por lo tanto la ingeniería de terreno es un servicio de apoyo a la construcción (SC).\r\n', '2025-07-16 14:22:45', '2025-07-16 14:35:08');
